offers.description:
СТРОГО БЕЗ ТОРГА! 

- ПТС Оригинал;
- Один собственник; 
- Производство, - Великобритания;
- Привезен из Японии в 2013 г. 

Отличное состояние, ухоженный, обслуженный, без каких-либо технических проблем, Установлено доп. оборудование: дополнительный свет (люстра), дорогая оптика головного света, усиленная вилка, тюнинг глушителя, 2-ух дисковые передние тормоза, армированные шланги, доп. спинка для пассажира, полка багажника, дорогое лобовое стекло, перешито сидение под маленький рост водителя…
